public class InnerVirtualServiceVirtualServiceProviderFactory(Action<Humidifier.AppMesh.VirtualServiceTypes.VirtualServiceProvider> factoryAction = null) : SubResourceFactory<Humidifier.AppMesh.VirtualServiceTypes.VirtualServiceProvider>
{

    internal InnerVirtualServiceVirtualNodeServiceProviderFactory VirtualNodeFactory { get; set; }

    internal InnerVirtualServiceVirtualRouterServiceProviderFactory VirtualRouterFactory { get; set; }

    protected override Humidifier.AppMesh.VirtualServiceTypes.VirtualServiceProvider Create()
    {
        var virtualServiceProviderResult = CreateVirtualServiceProvider();
        factoryAction?.Invoke(virtualServiceProviderResult);

        return virtualServiceProviderResult;
    }

    private Humidifier.AppMesh.VirtualServiceTypes.VirtualServiceProvider CreateVirtualServiceProvider()
    {
        var virtualServiceProviderResult = new Humidifier.AppMesh.VirtualServiceTypes.VirtualServiceProvider();

        return virtualServiceProviderResult;
    }
    public override void CreateChildren(Humidifier.AppMesh.VirtualServiceTypes.VirtualServiceProvider result)
    {
        base.CreateChildren(result);

        result.VirtualNode ??= VirtualNodeFactory?.Build();
        result.VirtualRouter ??= VirtualRouterFactory?.Build();
    }

} // End Of Class

